    return (
        <ProdutoContainer>
            <ProdFormContainer>
                <div className="title">Cadastro de Produto</div>
                <form>
                    <input></input>
                    <hr></hr>
                </form>
            </ProdFormContainer>
        </ProdutoContainer>
    );
}
